    /**
     * @return WebsiteServiceAbstract
     * @throws \Exception
     */
    public function getConfiguration(): WebsiteServiceAbstract
    {
        switch ($this->websiteName) {
            case 'cockringshop':
                return $this->cockringshop;
                break;
            case 'adultsmart':
                return $this->adultsmart;
                break;
            default:
                throw new \Exception('Uknown website');
        }
    }

    /**
     * @return mixed
     * @throws \Exception
     */
    public function home()
    {
        $categories = $this->getConfiguration()::getAllowedCategoryIds();

        $products = [];
        foreach ($categories as $categoryId) {
            $category = $this->categoryRepository->find($categoryId);
            $subcategories = $this->getConfiguration()->getCategoryFilter($categoryId);
            $categoryType = $this->getConfiguration()->determineCategoryType($category);
            $products[$categoryType]['category'] = $category;
            $productsFromCategories = $this->productRepository->findByWithinCategories(
                $subcategories,
                0,
                'p.productsPrice <> 0',
                0,
                $this->getConfiguration()->getNumProductsHomePage()
            );
            $products[$categoryType]['products'] = $this->attachProductsSlugForUrl($productsFromCategories);
        }

        return $products;
    }

