    /**
     * @param string $categoryName
     * @param int $start
     * @param int $limit
     * @return array
     * @throws \Doctrine\ORM\NoResultException
     * @throws \Doctrine\ORM\NonUniqueResultException
     * @throws \Exception
     */
    public function category(string $categoryName, int $start, int $limit): array
    {
        $category = $this->categoryRepository->find($this->mapCategoryToId($categoryName));
        $categories = $this->getConfiguration()->getCategoryFilter($category->getCategoriesId());
        $products = $this->productRepository->findByWithinCategories(
            $categories,
            0,
            'p.productsPrice <> 0',
            $start,
            $limit
        );
        $count = $this->productRepository->countByWithinCategories($categories);

        return ['results' => $products, 'count' => $count, 'category' => $category];
    }

