        return ['results' => $products, 'count' => $count];
    }

    /**
     * @param $categorySlug
     * @return string
     * @throws \Exception
     */
    public function getCategoryTemplate($categorySlug): string
    {
        $mainCategory = explode('/', $categorySlug);

        if (count($mainCategory) > 1) {
            return 'category_sub';
        }

        $category = $mainCategory[0];

        return 'category_'.$category;
    }

