    /**
     * @param $currentPage
     * @param $numPages
     * @return array
     */
    public function getVisiblePages($currentPage, $numPages): array
    {
        $visiblePages = [];
        for ($i = 1; $i <= $numPages; $i++) {
            if ($i <= 9 && $numPages <= 9) {
                $visiblePages[] = $i;
            } elseif ($i >= $currentPage - 4 && $i <= $currentPage + 5) {
                $visiblePages[] = $i;
            }
        }

        return $visiblePages;
    }

    /**
     * @param int $productId
     * @param string $category
     * @return array
     * @throws \Doctrine\ORM\NoResultException
     * @throws \Doctrine\ORM\NonUniqueResultException
     * @throws \Exception
     */
    public function product(int $productId, string $category): array
    {
        $categories = $this->getConfiguration()->getCategoryFilter();

        // Out of stock category
        $categories[] = 626;

        $product = $this->getProduct($productId);
        $productCategories = $product->getProductsCategoriesIds();

        if (count(array_intersect($categories, $productCategories)) === 0) {
            throw new \Exception('Product is not in the allowed categories');
        }

        $product = $this->productRepository->findByWithinCategoriesById($productCategories, $productId);


        return ['product' => $product];
    }

