    /**
     * @return array
     * @throws \Exception
     */
    public function sitemap(bool $withProducts = false): array
    {
        $sitemap = [];

        foreach ($this->getConfiguration()::getAllowedCategoryIds() as $categoryId) {
            $category = $this->categoryRepository->find($categoryId);
            $sitemap[$category->getCategoriesDescription()->getCategoriesName()] = [
                'category' => $category,
                'url' => $this->getConfiguration()->determineCategoryType($category),
            ];

            if ($withProducts) {
                $allowedCategories = $this->getConfiguration()->getCategoryFilter($categoryId, true);
                $products = $this->productRepository->findByWithinCategories(
                    $allowedCategories,
                    0,
                    'p.productsPrice <> 0',
                    0,
                    50000
                );
                $sitemap[$category->getCategoriesDescription()->getCategoriesName()]['products'] = $products;
            } else {
                $sitemap[$category->getCategoriesDescription()->getCategoriesName()]['products'] = [];
            }
        }

        return $sitemap;
    }

    /**
     * @return mixed|null
     * @throws \Psr\SimpleCache\InvalidArgumentException
     */
    public function sitemapXml(RouterInterface $router)
    {
        $cache = new FilesystemCache(
            $this->getConfiguration()->getDomainName().'-cache',
            24 * 3600,
            __DIR__.'/../../var/cache'
        );

        if (!$cache->has('xml.sitemap')) {
            $sitemapXml = [
                '<?xml version="1.0" encoding="utf-8"?>',
                '<urlset xmlns="http://www.sitemaps.org/schemas/sitemap/0.9"
   xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance"
   xsi:schemaLocation="http://www.sitemaps.org/schemas/sitemap/0.9 http://www.sitemaps.org/schemas/sitemap/0.9/sitemap.xsd">'
            ];

            $sitemap = $this->sitemap(true);

            foreach ($sitemap as $mainCat) {
                $sitemapXml[] = '<url>';
                $mainCatSlug = $this->generateCategorySlug($mainCat['category']);
                $sitemapXml[] = '    <loc>' . $router->generate('category_page_by_slug', [
                    'categorySlug' => $mainCatSlug,
                     'categoryId' => $mainCat['category']->getCategoriesId()]
                , UrlGeneratorInterface::ABSOLUTE_URL) . '</loc>';
                $sitemapXml[] = '    <changefreq>daily</changefreq>';
                $sitemapXml[] = '</url>';

                foreach ($mainCat['category']->getSubCategories() as $category) {
                    $sitemapXml[] = '<url>';
                    $catSlug = $this->generateCategorySlug($category);
                    $sitemapXml[] = '    <loc>' . $router->generate('category_page_by_slug', [
                                'categorySlug' => $catSlug,
                                'categoryId' => $category->getCategoriesId()]
                            , UrlGeneratorInterface::ABSOLUTE_URL) . '</loc>';
                    $sitemapXml[] = '    <changefreq>daily</changefreq>';
                    $sitemapXml[] = '</url>';
                }

                foreach ($mainCat['products'] as $product) {
                    $prodSlug = $this->slugService->getProductSlug($product);
                    $sitemapXml[] = '<url>';
                    $sitemapXml[] = '    <loc>' . $router->generate('product_page_by_slug', [
                                'productId' => $product->getProductsId(),
                                'productSlug' => $prodSlug,
                                'categorySlug' => $mainCatSlug,
                            ], UrlGeneratorInterface::ABSOLUTE_URL) . '</loc>';
                    $sitemapXml[] = '    <changefreq>weekly</changefreq>';
                    $sitemapXml[] = '</url>';
                }
            }

            $sitemapXml[] = '</urlset>';

            $cache->set('xml.sitemap', implode(PHP_EOL, $sitemapXml), 24 * 3600);
        }

        return $cache->get('xml.sitemap');
    }

