    /**
     * @param int $brandId
     * @param int $start
     * @param int $limit
     * @return array
     * @throws \Exception
     */
    public function brand(int $brandId, int $start, int $limit): array
    {
        $categories = $this->getConfiguration()->getCategoryFilter();
        $products = $this->productRepository->findByWithinCategoriesByManufacturersId($brandId, $categories, $start, $limit);
        $products = $this->attachCategoriesForUrl($products);
        $products = $this->attachProductsSlugForUrl($products);
