    public function attachBrandsSlugForUrl(array $brands): array
    {
        foreach ($brands as $brand) {
            $brand->setSlug($this->slugService->getBrandSlug($brand));
        }

        return $brands;
    }

    /**
     * @param array $products
     * @return array
     */
    public function attachProductsSlugForUrl(array $products): array
    {
        /** @var Product $product */
        foreach ($products as $product) {
            $product->setSlug($this->slugService->getProductSlug($product));
        }

        return $products;
    }

    /**
     * @param Category $category
     * @return string
     */
    public function generateCategorySlug(Category $category): string
    {
        if ($category->getCategoriesId() == 0) {
            return '';
        }

        if ($category->getParentId() == 0) {
            return $this->slugService->getCategorySlug($category);
        }

        $path = [];
        /** @var Category $category */
        foreach ($category->getPath() as $parentCategory) {
            if ($parentCategory->getCategoriesId() == 0) {
                break;
            }
            $path[] = $this->slugService->getCategorySlug($parentCategory);
        }

        return implode('/', $path);
    }

    /**
     * @param int $categoryId
     * @return string
     */
    public function generateCategorySlugById(int $categoryId): string
    {
        if ($categoryId == 0) {
            return '';
        }
        $category = $this->categoryRepository->find($categoryId);

        return $this->slugService->getCategorySlug($category);
    }

    /**
     * @param int $start
     * @param int $limit
     * @return array
     * @throws \Exception
     */
    public function reviews(int $start, int $limit): array
    {
        $categories = $this->getConfiguration()->getCategoryFilter();
        $reviews = $this->reviewRepository->findInCategoriesBy($categories, 'r.reviewsId', 'DESC', $limit, $start);
        $count = $this->reviewRepository->countInCategoriesBy($categories);
        /** @var Review $review */
        foreach ($reviews as $review) {
            $productWithSlug = $this->attachProductsSlugForUrl([$review->getProduct()])[0];
            $productWithSlug = $this->attachCategoriesForUrl([$productWithSlug])[0];
            $review->setProduct($productWithSlug);
        }

        return ['results' => $reviews, 'count' => $count];
    }

    /**
     * @param int $productId
     * @param int $start
     * @param int $limit
     * @return array
     * @throws \Exception
     */
    public function productReviews(int $productId, int $start, int $limit): array
    {
        $reviews = $this->reviewRepository->findBy(['productsId' => $productId, 'reviewsStatus' => 1], ['reviewsId' => 'DESC'], $limit, $start);
        $count = 400;
        /** @var Review $review */
        foreach ($reviews as $review) {
            $productWithSlug = $this->attachProductsSlugForUrl([$review->getProduct()])[0];
            $productWithSlug = $this->attachCategoriesForUrl([$productWithSlug])[0];
            $review->setProduct($productWithSlug);
        }

        return ['results' => $reviews, 'count' => $count, 'product' => $this->productRepository->find($productId)];
    }

    public function getOrders(int $userId): array
    {
        $orders = $this->orderRetailRepository->findBy(['customersId' => $userId], ['ordersId' => 'DESC']);
        foreach ($orders as $order) {
            $products = [];
            foreach ($order->getProducts() as $orderProduct) {
                $product = $this->productRepository->find($orderProduct->getProductsId());
                if ($product) {
                    $product = $this->attachProductsSlugForUrl([$product])[0];
                    $orderProduct->setProduct($product);
                    $products[] = $orderProduct;
                }
            }
            $order->setProducts(new ArrayCollection($products));
            $order->setOrderStatusRetail($this->orderStatusRetailRepository->find($order->getOrdersStatus()));

            $orderStatusHistory = $this->orderStatusHistoryRetailRepository->findBy(
                ['ordersId' => $order->getOrdersId()],
                ['dateAdded' => 'ASC']
            );
            foreach ($orderStatusHistory as $k => $orderStatusHistoryRetail) {
                $orderStatusHistory[$k]->setOrdersStatus($this->orderStatusRetailRepository->find($order->getOrdersStatus()));
            }
            $order->setOrderStatusHistoryRetail($orderStatusHistory);

            $orderTotals = $this->orderTotalRetailRepository->findBy(
                ['ordersId' => $order->getOrdersId()],
                ['sortOrder' => 'ASC']
            );
            $orderTotals = array_combine(array_map(function ($orderTotal) {
                return $orderTotal->getClass();
            }, $orderTotals), $orderTotals);
            $order->setOrderTotalRetail($orderTotals);
        }

        return $orders;
    }

