<br />The Great Sandy Strait, separating Fraser Island from the mainland, is an important wetlands area. Among the 40,000 migratory shorebirds the wetlands are home to rare and endangered species such as Dugongs. 
<br />How Long should you stay on Fraser Island?
<br />A single day will not be enough to get the most out of Fraser Island but understand if you have no choice (I just pity you). Two or three days will probably do it unless you love camping and can afford the time.
<br />Stay a-while Fraser Island, Queensland
<br />The reality is you probably should sell everything you own and stay in Queensland for as long as you physically can but it would be irresponsible to suggest any such thing so don\'t do it (but I know the feeling)
<br />Visit Fraser Island
<br />One of Fraser Island\'s Stunning Lakes
<br />If you want to visit Fraser Island you would be advised to overnight to make the most of your stay. A tour will help to ensure you see the best bits.
<br />Glass House Mountains
<br />On route you\'ll see the Glass House Mountains and Sunshine Coast before arriving at Rainbow Beach. On Fraser Island itself you will experience 75 Mile Beach and Eli Creek. The lovely board walk to the top of the creek will stick in your memory almost as much as floating down this picturesque stream. 
<br />Lake Wabby
<br />After that you will walk through a lush coastal eucalypt forest which opens out to the deepest lake on Fraser Island, the famous Lake Wabby. The return walk takes us through the Hammerstone Sandblow. 
<br />The Lakes of Fraser Island
<br />You also get to appreciate the Eurong Beach Resort, lush subtropical rainforests, the clear flowing waters of Wanggoolba Creek. For me the highlight is Lake Birrabean, one of Fraser Islands Beautiful crystal clear lakes. The clear Fraser Island lakes have to be seen to be believed.
<br /> 14  The Fraser Sea - Hervey Bay
<br />Pretty sure there is no such a thing as the Fraser Sea but it is an island and a many a beautiful and splendid things it is to be seen on, off and in the beautiful Fraser Sea of off Fraser Island.
<br />Fraser Island Whales and Dolphins - Hervey Bay
<br />Hervey Bay Whales having a Whale of a time.
<br />Enjoy this awesome whale cruise which has been running for years and will not stop until they find one.....just joking :) 
<br />15 Fraser Island in a Day - Intrepid Explorers Only
<br />There are 4WD tours and then there is this one. There are no half measures on this tour. You will "invade" Fraser Island in a 20-Seat 4WD Warrior. You will take Teewah or Rainbow Beach (and it\'s coloured sands), traverse 75 mile Beach to Central Station or Pile Valley then proceed to a full scale rainforest assault. After that it\'s a covert swim in Lake McKenzie or Lake Birrabeen. The escape route is through the ancient Satinay and Brushbox forests down the sandy highway for a recovery tea stop on a remote beach before returning to Noosa and de-brief - Phew!
