            $str .= 'If you live for adventure and love the great outdoors, you\'ve found your spiritual home in the Northern Territory. Walk, swim, sail or fly to experience the region\'s dramatic landscapes, diverse wildlife and ancient heritage, from vast red deserts, hidden waterholes and outback stations to plunging gorges, rocky outcrops and pristine white beaches.<br />
Northern Territory (abbreviated as NT) is a federal Australian territory in the centre and central northern regions of Australia. It shares borders with Western Australia to the west South Australia to the south , and Queensland to the east.<br />
To the north, the territory is bordered by the Timor Sea, the Arafura Sea and the Gulf of Carpentaria. Despite its large area-over 1,349,129 square kilometres (520,902 sq mi), making it the third largest area in Australian it has only 233,300.   It has the smallest population of any other state or territory of Australia.<br />
Adultsmart adults shop uses express post so even though NT is remote Adultsmart deliveries are quick.  Lingerie is the most popular item sold in the Northern territories although males sex toys and masturbators also are best sellers.<br /><br />

The Main Regions of Nothern Territory are -<br /><br />
-   Arnhem Land<br />
-   Barkly Tableland<br />
-   Central Australia/Alice Springs Region/Red Centre<br />
-   Darwin Region<br />
-   Katherine Region<br />
