Best Things to do in Northern Territories are -<br /><br />
1. Uluru<br />
Nothing in Australia is as readily identifiable as Uluru (Ayers Rock). No matter how many times you\'ve seen it on postcards, nothing prepares you for the hulk on the horizon - so solitary and impressive. Uluru is 3.6km long and rises a towering 348m from the surrounding sandy scrubland (867m above sea level). If that\'s not enough, it\'s believed that two-thirds of the rock lies beneath the sand. Closer inspection reveals a wondrous pitted and contoured surface concealing numerous sacred sites of particular significance to the Anangu people. If your first sight of Uluru is during the afternoon, it appears as an ochre-brown colour, scored and pitted by dark shadows. As the sun sets, it illuminates the rock in burnished orange, then a series of deeper and darker reds before it fades into charcoal. A performance in reverse, with marginally fewer spectators, is given at dawn.<br /><br />

2. The Olgas<br />
A striking group of domed rocks huddle together about 35km west of Uluru to form Kata Tjuta (the Olgas). There are 36 domed rocks shoulder to shoulder forming deep valleys and steep-sided gorges. Most visitors find them as captivating as their prominent neighbour. The tallest rock, Mt Olga (546m, 1066m above sea level) is approximately 200m higher than Uluru. Kata Tjuta means \'many heads\' and is of great tjukurpa significance, so climbing on the domed rocks is not advised.<br /><br />

3. Kings Canyon<br />
Watarrka (Kings Canyon) National Park features one of the most spectacular sights in central Australia - the yawning chasm of Kings Canyon. The Kings Creek Walk is an easy trail following the rocky creek bed to a raised platform with views of the towering canyon rim. Walkers are rewarded with awesome views on the strenuous Kings Canyon Rim Walk. After a steep climb, the walk skirts the canyon\'s rim before entering the Garden of Eden: a lush pocket of cycads around a natural pool.<br /><br />

4. Kakadu National Park<br />
Kakadu National Park showcases the remarkable landscape, wildlife and cultural heritage of the Northern Territory. It is so much more than just a nature reserve; it is a celebration of the enduring link between the Indigenous custodians and the country they have nurtured for thousands of years. Visit wondrous and enigmatic rockart sites and explore spectacular wildlife-teeming wetlands with local guides. <br /><br />

5. Mindil Beach Sunset Market<br />
At sunset, half of Darwin descends on Mindil Beach Sunset Market with tables, chairs, rugs, grog and kids to settle under the coconut palms for sunset, and decide which of the tantalising food-stall aromas has the allure; try a flaming satay stick from Bobby\'s brazier. Top it off with fresh fruit salad, decadent cakes or luscious crepes. But that\'s only half the fun: arts and crafts stalls bulge with handmade jewellery, fabulous rainbow tie-died clothes, Indigenous artefacts, and wares from Indonesia and Thailand. Patrons peruse and promenade, or stop for a pummelling massage or to listen to rhythmic live music.<br /><br />

6. The Tiwi Islands<br />
Bathurst and Melville Islands lie about 80km north of Darwin, and are home to the Tiwi Aboriginal people. The Tiwis (\'We People\') have a distinct culture and today are well known for producing vibrant art and the odd champion Aussie Rules football player. Tourism is restricted on the islands and for most tourists the only way to visit is on one of the daily organised tours from Darwin. Well-known features of their culture are the pukumani (burial poles), carved and painted with symbolic and mythological figures, which are erected around graves.<br /><br />

7. Katherine Gorge<br />
Spectacular Katherine Gorge forms the backbone of this 2920-sq-km park, about 30km from Katherine. A series of 13 deep sandstone gorges have been carved out by the Katherine River on its journey from Arnhem Land to the Timor Sea. It is a hauntingly beautiful place - though it can get crowded in peak season - but prioritise this as a visit from Katherine town. In the Dry, the tranquil river is perfect for a paddle, but in the Wet the deep still waters and dividing rapids are engulfed by an awesome torrent that churns through the gorge. Plan to spend at least a full day canoeing or cruising on the river and bushwalking. <br /><br />

8. The jumping croc circus<br />
Few people seem to be able to resist the sight of a 5m-long saltwater crocodile launching itself out of the water towards a hunk of meat. Like a well-trained circus act, jumping out of the water to grab prey is actually natural behaviour for crocs, usually to take surprised birds or animals from overhanging branches. It is still a thoroughly amazing sight - have your camera at the ready. <br /><br />

9. Litchfield National Park<br />
Litchfield National Park is renowned for bushwalking, camping and especially swimming, with waterfalls plunging into gorgeous, safe swimming holes. The 1500-sq-km national park encloses much of the spectacular Tabletop Range, a wide sandstone plateau mostly surrounded by cliffs. The waterfalls that pour off the edge of this plateau are a highlight of the park, feeding crystal-clear cascades and croc-free plunge pools. <br /><br />

10. Territory Wildlife Park<br />
Aussie wildlife is showcased here in a state-of- the-art open-air zoo. You can spend years looking around in the wild and still not see half of what\'s on display here. Highlights include the Flight Deck, where birds of prey display their intelligence and dexterity; and the nocturnal house, where you can observe nocturnal fauna such as bilbies and bats. Pride of place must go to the aquarium, where a walk-through clear tunnel puts you among giant barramundi, stingray, sawfish, saratoga and a score of others, while a separate tank holds a 3.8m saltwater crocodile.<br /><br />


