            $str .= 'Adultsmart delivers to Tasmania, Australia.  Tasmania is a place of wild and beautiful landscapes, friendly, helpful people with a relaxed island lifestyle, wonderful wine and food and a haunting history evoked by spectacular convict-era ruins.  There are just over half a million people residing in Tasmania and Tasmania\'s area is 68,401 square kilometres.
