<br />So no matter where you go in Tasmania, whether you spend time in one location or drive around the island, we know you\'ll be delighted by what you\'ll find and surprised at how much bigger Tasmania really is on the inside.
<br />Up until recently Tasmania had the record for mass murder at Port Arthur  by Martin Bryant (born 7 May 1967) is an Australian mass murderer who pleaded guilty to murdering 35 people and injuring 23 others in the Port Arthur massacre, a shooting spree in Port Arthur, Tasmania, Australia, in 1996. He is currently serving 35 life sentences plus 1,035 years without parole in the psychiatric wing of Risdon Prison in Hobart, Tasmania. His rampage ranks among the deadliest of the 20th century.
<br />Tasmania is divided into the following regions -
