<strong>Off Piste</strong>
<br />
Off Piste is going off the beaten track to bring a sense of adventure to the Fleurieu Peninsula\'s food and wine scene. Sample wine at beautiful beaches, lunch atop a cliff, and discover nature and wildlife in untamed conservation parks.
<br />
<strong>Hahndorf Walking Tours</strong>
<br />
Discover the old village of Hahndorf with Hahndorf Walking Tours and discover the history, stories and architecture of this beautiful Adelaide Hills town.
<br />
<strong>Houseboats</strong>
<br />
Enjoy the majesty and beauty of South Australia\'s Murray River. Drift leisurely with the current, past its red sandstone cliffs and tree lined banks, on-board a well-equipped houseboat.
<br />
<strong>Gawler Ranges</strong>
<br />
Once you\'ve devoured Eyre Peninsula\'s seafood take a turn inland and discover one of South Australia\'s natural wonders, the Gawler Ranges.
<br />
<strong>Mr Mick</strong>
<br />
Known for its rolling hills, rows of vines and Riesling, Mr Mick is just one of the gems found in the Clare Valley.
<br />
<strong>Naracoorte Caves</strong>
<br />
The Naracoorte Caves National Park is South Australia\'s only World Heritage site. Walk among delicate stalagmites and beneath stalactites, marvelling at these ancient natural decorations.
